import React from 'react';
import './App.css';
import Cabeza from "./componentes/Cabeza";
import Contenido from "./componentes/Contenido";
import Botones from "./componentes/Botones";
import Formulario from "./componentes/Formulario";

function App() {
  return (
    <div className="App">
        <Cabeza />  

        <Formulario />  
        <Botones />       
    </div>
  );
}

export default App;
